import React, { Component } from 'react';

class AboutPage extends Component {
    render() {
        return (
            <div>
                <h1 className='header'>ABOUT THIS PAGE</h1>
                <p className='text'>This page was written in REACT using Javascript, CSS, and HTML</p>
            </div>
        );
    }
}

export default AboutPage;
